    - type: Paper
      content: "This was my first map and I'm proud of how it's been received, but also because of how much of the game I've learned as a result.\n \nAngle Station was made possible with help from Pspritechologist, Parky, OldDanceJacket, and everyone that was willing to help me in the Nyanotrasen community. Angle would not be where it is without everyone's help...\n \nIncluding yours! Thank you for playing on Angle!\n \nWith love,\rColin_Tel\n"
